import React from "react";

const Definition = () => {
  return (
    <div className="container my-4">
      <h2 className="text-primary">Definition</h2>
      <div className="card p-3 shadow-sm">
      <p>
  A <strong>User</strong> refers to any individual or legal entity who subscribes to the services of <strong>VPHomes</strong>. Access is granted through a unique username and password, either assigned by VPHomes or chosen by the user. This ensures that only authorized individuals can use the services provided by VPHomes.
</p>

<p>
  The term <strong>Browser</strong> or <strong>Visitor</strong> applies to anyone who accesses the publicly available sections of <strong>VPHomes</strong> without creating an account. Meanwhile, an <strong>Advertiser</strong> is a user who publishes content using VPHomesâ€™ services.
</p>

<p>
  Access to <strong>VPHomes</strong> is subject to its terms, conditions, and community guidelines. Any person who uses the services without legal authorization is considered an <strong>unauthorized user</strong>. Even so, they remain bound by the terms, particularly regarding compliance with intellectual property laws and the guidelines set forth by IEIL.
</p>

<p>
  The terms <strong>"User"</strong> and <strong>"Customer"</strong> collectively refer to all Subscribers, Advertisers, Browsers, and Visitors utilizing the platform.
</p>

<p>
  <strong>Services</strong> provided by <strong>VPHomes</strong> include interactive online information, allowing users to access a database maintained by the platform. These services also encompass advanced search tools that help users filter through hosted data efficiently. Additionally, the platform offers advertising space, including listings and banner placements. However, VPHomes strictly functions as an information exchange medium and does not act as an agent, either explicitly or implicitly, on behalf of any customer.
</p>

       
        </div>
    </div>
  );
};

export default Definition;
